import axios from "axios";

const setAuthToken2 = (token) => {
	if (token) {
		axios.defaults.headers.common["y-Auth-Token-For-Users"] = token;
	} else {
		delete axios.defaults.headers.common["y-Auth-Token-For-Users"];
	}
};

export default setAuthToken2;
